import React from "react";
import { BsFillEyeFill } from "react-icons/fa";
// import { BsFillEyeSlashFill } from "react-icons/fa";
const LoginBox = (props) => {
  const submitLogin = () => {};
  return (
    <div className="login-box box-container">
      <h3>خوش آمدید</h3>
      {/* <div className="input-group">  */}

      <input
        type="email"
        name="email"
        className="login-input"
        placeholder="پست الکترونیک"
      />
      {/* <span class="pseudoPlaceholder"> پست الکترونیک *</span> */}
      <input
        type="password"
        name="password"
        className="login-input"
        placeholder="کلمه عبور"
      />
      <BsFillEyeFill className="open-eye" />
      <BsFillEyeSlashFill className="close-eye" />

      <p className="forget"> فراموش کردید؟</p>
      <button type="button" className="login-btn btn" onClick={submitLogin}>
        ورود
      </button>
      {/* </div> */}
    </div>
  );
};
export default LoginBox;
